export default function NavigationItem(props) {
    return (
        <li className="li-nav-item">
            {/*<a href={props.link}>*/}
            {props.link}
                <i className={props.icon}></i>
                &nbsp;&nbsp;
                {props.linkText}
            {/*</a>*/}
        </li>
    )
}
